	public void sudoku(byte[][] board, int x, int y) {
		//System.out.println("Sudoku [" + x + "][" + y + "]");
		if (isSolution(x, y)) {
			printSolution(board);
			finished = true;
		} else {
			y = y + 1;
			if (y > 8) {
				x = x + 1;
				y = 0;
			}
			
			if (board[x][y] != 0) {
				sudoku(board, x, y);
			} else {
				byte candidates[] = constructCandidates(board, x, y, new byte[9]);
				int candidateLength = constructCandidates(board, x, y);			
				for (int c = 0; c < candidateLength; c++) {
					board[x][y] = candidates[c];
					sudoku(board, x, y);
					board[x][y] = 0;
					if (finished) {
						return;
					}
				}
			}
		}
	}
	
	public boolean isSolution(int row, int col) {
		if (row == 8 && col == 8) {
			return true;
		} else {
			return false;
		}
	}
	
