	public int constructCandidates(byte[][] board, int row, int col) {
		int count = 0;
		
		byte rLength = rowSet(board, row);
		byte cLength = colSet(board, col);
		byte gLength = gridSet(board, row, col);
		
		for (byte i = 1; i <= 9; i++) {
			if (contains(rSet, i, rLength)) {
				continue;
			}
			if (contains(cSet, i, cLength)) {
				continue;
			}
			if (contains(gSet, i, gLength)) {
				continue;
			}
			count++;
		}
		return count;
	}
	
	public byte[] constructCandidates(byte[][] board, int row, int col, byte[] candidates) {
		int count = 0;
		
		byte rLength = rowSet(board, row);
		byte cLength = colSet(board, col);
		byte gLength = gridSet(board, row, col);
		
		for (byte i = 1; i <= 9; i++) {
			if (contains(rSet, i, rLength)) {
				continue;
			}
			if (contains(cSet, i, cLength)) {
				continue;
			}
			if (contains(gSet, i, gLength)) {
				continue;
			}
			candidates[count] = i;
			count++;
		}
		return candidates;
	}
	
	public boolean contains(byte[] array, byte b, int length) {
		for (int i = 0; i < length; i++) {
			if (array[i] == b) {
				return true;
			}
		}
		return false;
	}
	
	public byte rowSet(byte[][] board, int row) {
		byte count = 0;
		for (int i = 0; i < 9; i++) {
			if (board[row][i] != 0) {
				rSet[count] = board[row][i];
				count++;
			}
		}

		return count;
	}
	
	public byte colSet(byte[][] board, int col) {
		byte count = 0;
		for (int i = 0; i < 9; i++) {
			if (board[i][col] != 0) {
				cSet[count] = board[i][col];
				count++;
			}
		}
		return count;
	}
	
	public byte gridSet(byte[][] board, int row, int col) {
		int r_start = row / 3 * 3;
		int c_start = col / 3 * 3;
		byte count = 0;
		for (int i = r_start; i < r_start + 3; i++) {
			for (int j = c_start; j < c_start + 3; j++) {
				if (board[i][j] != 0) {
					gSet[count] = board[i][j];
					count++;
				}
			}
		}
		return count;
	}
